addObject({name:"foodParticle",sprite:sprites.get("foodParticle"),parent:"physics",lifeMax:0,collider:{type:"point"},setParams(i,t,s,e){this.ax=i.x*t,this.ay=i.y*t,this.life=s,this.lifeMax=s,this.g=e},step(){this.physics(),this.life<=0?instanceDestroy(this):this.life--,this.opacity=this.life/this.lifeMax}});